import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class BankdataService {
  useremail:any = ""
  userbank: any = ""
  constructor(private http: HttpClient) { }
  addLogin(data:any):Observable<any>{
    return this.http.post('http://localhost:8080/mean/adduser',data)
  }
  checkdata():Observable<any>{
    console.log(this.userbank)
    return this.http.get('http://localhost:8080/mean/checkdata/'+this.userbank)
  }
  addBank(data: any):Observable<any>{
    return this.http.post('http://localhost:8080/mean/addBank/'+this.userbank,data)
  }
  editBank(data:any):Observable<any>{
    return this.http.put('http://localhost:8080/mean/editData/'+this.userbank,data)
  }
  deleteBank(data:any):Observable<any>{
    return this.http.put('http://localhost:8080/mean/deleteData/'+this.userbank,data)
  }
}
